'''''Mythlore'' 77''' ([https://dc.swosu.edu/mythlore/vol20/iss3/ Volume 20, Issue 3]) is an issue of the ''[[Mythlore]]'' journal, published by the [[Mythopoeic Society]].

==Contents==
This is one of several short supplemental issues that ''Mythlore'' published in order to comply with bulk mailing permit regulations. This issue mainly consisted of an editorial by Glen H. GoodKnight and information about the upcoming 1995 Mythopoeic Conference.{{mythlorenav|76|78}}
